import './App.css';
// import axios from 'axios';
import Header from './Header';
import About from './About';
import myCookbook from './myCookbook';
import myKitchen from './myKitchen';
import home from './About';


import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

function App() {
  return (
    <>
    <Router>
      <Header />
      <Routes>
        <Route
          exact path="/"
        >
        </Route>
        <Route
          path={"/about"}
          element={<About />}
        >
        </Route>
        <Route
          path={"/profile"}
          element={<Profile />}
        ></Route>
      </Routes>
      <div className="App">
        <h1>Hello</h1>
      </div>
      </Router>
    </>
  );
}

export default App;
